        n6 = Noticia(5,'Número de casos graves e óbitos por Covid caem 99% no Ceará, diz secretaria','https://s2.glbimg.com/f-FxLpblGz2HJ7BVcBhWh2aKHxM=/0x0:1280x853/984x0/smart/filters:strip_icc()/i.s3.glbimg.com/v1/AUTH_59edd422c0c84a879bd37670ae4f538a/internal_photos/bs/2020/9/L/TAxRTeRnqaQYupMBa99A/whatsapp-image-2020-05-05-at-12.53.41-1-.jpeg','Entre janeiro e março deste ano, o Ceará teve uma redução de 99% nos diagnósticos positivos para a Covid-19. As confirmações caíram de 234.027, em janeiro, para 1.911 em março. Os dados são da Secretaria da Saúde do Ceará (Sesa) disponibilizados na plataforma IntegraSUS. Na mesma tendência, segundo a Sesa, o número de mortes saiu de 934 para 122 no período, uma queda de 87%. O Ceará deu início a uma nova etapa na imunização com mais de 80 mil idosos estão aptos a receber a segunda dose de reforço da vacina contra a Covid-19. Nesta semana também foi iniciada a campanha de vacina contra a gripe, que prioriza os idosos na primeira etapa.')
