        n8 = Noticia(7,'Covid-19: máscara e passaporte da vacina deixam de ser obrigatórios; ES não terá mais mapa de risco','https://www.es.gov.br/Media/PortalES/Noticias/13%C2%BA-MAPA-DE-RISCO---13-a-19.07.jpg','A partir desta quarta-feira (6), o uso de máscara deixa de ser obrigatório em todo o Espírito Santo. Em coletiva de imprensa realizada nesta tarde, o governador Renato Casagrande afirmou que, com os bons resultados no início de abril, redução do número de casos, óbitos e internações por covid-19 no Estado capixaba, o mapa da matriz de risco também não será mais elaborado. O passaporte vacinal também deixará de ser exigido.')
        n9 = Noticia(8,'Goiânia passa a ter drive-thru para vacinação contra gripe e Covid-19','https://s2.glbimg.com/eG1YulAZZMW8hrXPFOZR5tgvIXo=/0x0:768x512/984x0/smart/filters:strip_icc()/i.s3.glbimg.com/v1/AUTH_59edd422c0c84a879bd37670ae4f538a/internal_photos/bs/2021/P/t/AXI2swQseyMHowI3SAbQ/whatsapp-image-2021-05-31-at-13.31.11-1-768x512.jpeg','A Secretaria Municipal de Saúde anunciou que Goiânia terá um drive-thru para vacinação contra a gripe e a Covid-19. A partir desta terça-feira (5), os moradores podem ser vacinados no estacionamento do Estádio Serra Dourada, sem agendamento. O atendimento será feito das 8h às 16h, de segunda-feira à sexta-feira. Com o local, a capital passa a ter 73 pontos de vacinação (veja abaixo os endereços). A prefeitura informou que até o dia 30 deste mês, podem tomar a vacina contra a gripe os idosos com 60 anos ou mais e trabalhadores da saúde. Depois do dia 2 de maio até 3 de junho, serão os outros grupos prioritários (veja a lista abaixo).')
        n10 = Noticia(9,'Maranhão completa uma semana sem registro de mortes por Covid-19','https://s2.glbimg.com/7TzGzN6c5oC1ZD6SM9-a96iEdNg=/0x0:1024x683/984x0/smart/filters:strip_icc()/i.s3.glbimg.com/v1/AUTH_59edd422c0c84a879bd37670ae4f538a/internal_photos/bs/2021/g/Y/BPnsgKSKOARN0lCiLyuw/whatsapp-image-2021-12-27-at-14.26.13.jpeg','O Maranhão completou neste domingo (3) uma semana sem registro de mortes por Covid-19, segundo a Secretaria de Estado da Saúde (SES). Os registros são de 28 de março a 3 de abril e foram obtidos a partir do boletim epidemiológico que é divulgado diariamente pela pasta. Na mesma semana, foram 2.093 casos registrados da doença e está em tendência de queda. Neste domingo (3), 18 foram registrados na Ilha de São Luís e 4 nas remais regiões do estado.')
        n11 = Noticia(10,'MT registra menor taxa de ocupação de leitos de UTI Covid em quase dois anos','https://s2.glbimg.com/Rk7UJQz12A8I39o3-MRf_aAJ1qQ=/0x0:1024x683/984x0/smart/filters:strip_icc()/i.s3.glbimg.com/v1/AUTH_59edd422c0c84a879bd37670ae4f538a/internal_photos/bs/2021/I/B/iT9iGcR22vAWHTzFxrXA/tch5376.jpg','Mato Grosso registrou nesta terça-feira (5) a menor taxa de ocupação de leitos de Unidade de Terapia Intensiva (UTI) para Covid-19 desde maio de 2020. De acordo com o boletim epidemiológico da Secretaria de Saúde (SES), a taxa de ocupação está em 20,35%. Com a queda nas internações, dois hospitais de Mato Grosso não possuem nenhum paciente internado em UTI. O Hospital Municipal de Juína e o Regional de Sinop, estão com os leitos de UTI exclusivos para pacientes com coronavírus vagos. Outros dois hospitais estão com a taxa de ocupação em 10%. O Hospital e Maternidade Santa Rita e o Hospital Vale do Guaporé estão com um paciente internado em cada unidade.')
