        n13 = Noticia(12,'Covid-19: 22 pessoas morrem nas últimas 24 horas em Minas Gerais','https://s2.glbimg.com/KOBGFl3zslQ4wIchTsAzUtMPx-s=/0x0:858x483/984x0/smart/filters:strip_icc()/i.s3.glbimg.com/v1/AUTH_59edd422c0c84a879bd37670ae4f538a/internal_photos/bs/2020/A/s/YBnqBBRnGDcjiQTWkCtg/sars.jpg','Vinte e duas pessoas morreram nas últimas 24 horas em Minas Gerais por causa da Covid-19, informou, neste domingo (20), a Secretaria de Estado de Saúde (SES). Ainda segundo o órgão, no mesmo período, houve 1.158 casos da doença. Desde o início da pandemia, 3.296.877 pessoas testaram positivo para o coronavírus no estado. Destas, 3.168.768 são consideradas recuperadas. Outros 67.549 pacientes estão em acompanhamento.')
        n14 = Noticia(13,'Pará registra 756.881 casos e 18.125 mortes por Covid-19','https://s2.glbimg.com/MW0_5yUtU0LuveAxpAzrvnFlJz4=/0x0:1920x960/984x0/smart/filters:strip_icc()/i.s3.glbimg.com/v1/AUTH_59edd422c0c84a879bd37670ae4f538a/internal_photos/bs/2021/Q/x/B8DlKjT12NHuoC9jAmYQ/virus-molecula-covid-19-coronavirus-cred-peter-linforth-pixabay.jpg','O Pará contabilizou mais 757 casos de Covid-19 e 4 mortes causadas pela doença, segundo o boletim divulgado pela Secretaria de Saúde Pública do Pará (Sespa) nesta segunda-feira (4). Agora são 756.881 pessoas diagnosticadas com a doença desde março de 2020, sendo que 18.125 morreram. Houve 6 casos confirmados e uma morte registrada nos últimos sete dias. Em relação à subnotificação das prefeituras, foram confirmados mais 751 casos e 3 mortes ocorridas em dias anteriores.')
        n15 = Noticia(14,'Novo decreto de João Pessoa volta a exigir teste negativo de Covid-19 para acesso a shows','https://s2.glbimg.com/DrP-mhNs_x6_5JNFjaxflzVJ35k=/0x0:400x267/984x0/smart/filters:strip_icc()/i.s3.glbimg.com/v1/AUTH_59edd422c0c84a879bd37670ae4f538a/internal_photos/bs/2020/W/X/Hd2ThcR76W4h8Bh3EPgA/whatsapp-image-2020-10-22-at-16.16.14.jpeg','A Prefeitura de João Pessoa publicou no Diário Oficial Eletrônico deste sábado (2) um novo decreto com medidas de enfrentamento e prevenção à pandemia da Covid-19. O documento mantém as mesmas regras do anterior, com algumas exceções, e tem validade até o dia 7 de abril, data em que também perderá o vigor o decreto estadual. De acordo com o decreto, uma das mudanças em relação ao decreto anterior é inclusão da obrigatoriedade da apresentação de teste de antígeno negativo para Covid-19, realizado em até 72 horas antes dos eventos, para o ingresso em shows.')
        n16 = Noticia(15,'Nove dias após liberação das máscaras ao ar livre, números da pandemia seguem em queda','https://www.aen.pr.gov.br/sites/default/arquivos_restritos/files/imagem/2022-03/mascaras3.jpg','Nove dias após a liberação do uso de máscaras em ambientes externos no Paraná, a Secretaria de Estado da Saúde (Sesa) analisou os números da pandemia para avaliar se o decreto governamental e a resolução da pasta interferiram na curva de contaminados. Neste sábado (26), o Estado completa dez dias sem a obrigatoriedade do uso ao ar livre ou para crianças menores de 12 anos. Os números de casos, óbitos e internações pela Covid-19 já apresentavam queda significativa quando a medida foi tomada e, agora, mais de uma semana após a liberação, a redução é ainda maior. A taxa de reprodução eficaz, ou Rt, número médio de contágios causados por cada pessoa infectada, indica a velocidade de contaminação da Covid-19 em cada localidade. Atualmente o Paraná está com 0,92, o que significa que 100 pessoas contaminadas pelo vírus Sars-CoV-2 transmitem, em média, para 92 novas pessoas. Os números são diferentes dos registros de 13 de janeiro, no pico da Ômicron, quando o Paraná atingiu o maior RT desde o início da pandemia, com 1,92.')
        n17 = Noticia(16,'Pernambuco registra, nesta quinta (7), sete mortes e 1.378 casos da Covid-19','https://cdn.folhape.com.br/img/pc/1100/1/dn_arquivo/2022/01/mg-2895-credito-miva-filho-ses-pe.webp','Sete óbitos e 1.378 casos da Covid-19 foram registrados em Pernambuco, nesta quinta-feira (7), pela Secretaria Estadual de Saúde (SES-PE). Agora Pernambuco contabiliza 21.461 mortes pela Covid-19 e 905.319 casos confirmados da doença, sendo 58.388 graves e 846.931 leves.')
        n18 = Noticia(17,'Mulher de 31 anos morre vítima da Covid-19 em Teresina; Piauí chega a 7.708 óbitos pela doença','https://s2.glbimg.com/gqPgpVDzr64GvGksuEgJnQDuyAI=/0x0:5500x3666/984x0/smart/filters:strip_icc()/i.s3.glbimg.com/v1/AUTH_59edd422c0c84a879bd37670ae4f538a/internal_photos/bs/2021/j/m/ZxIH2JTjWBX2IQQcSb8Q/2021-07-10t143639z-1788242058-rc2tfo9b6pug-rtrmadp-3-global-population-brazil.jpg','Uma mulher de 31 anos, de Teresina, morreu vítima da Covid-19, segundo o boletim epidemiológico da Secretaria de Saúde do Piauí (Sesapi) divulgado nesta terça-feira (15). Além dela, uma idosa de 87 anos, residente no município de Nossa Senhora dos Remédios, e um idoso de 77 anos, de São Pedro do Piauí, faleceram em decorrência da doença. O estado também registrou 160 novos casos da Covid-19. Do total, 99 são mulheres e 61 são homens, com idades que variam de 02 a 81 anos. Os casos confirmados no estado somam 366.815 em todos os municípios piauienses. Já os óbitos pelo novo coronavírus chegam 7.708 casos e foram registrados em 224 municípios.')
        n19 = Noticia(18,'Mapa de Risco da Covid-19: estado do Rio de Janeiro volta para bandeira verde','https://www.saude.rj.gov.br/comum/code/MostrarImagem.php?C=NDgxNDE%2C','A 72ª edição do Mapa de Risco da Covid-19, divulgada nesta sexta-feira (11.03) pela Secretaria de Estado de Saúde (SES), mostra que o estado do Rio de Janeiro voltou para a bandeira verde (risco muito baixo) após um período de três meses. A análise compara a sétima semana epidemiológica (SE 07) deste ano, 13/02/2022 a 19/02/2022, com a nona semana (SE 09), 27/02/2022 a 05/03/2022. O mapa desta semana mostra que a Região Metropolitana I saiu da bandeira amarela (risco baixo) e está em bandeira verde (risco muito baixo). A Região Metropolitana II se manteve em bandeira verde (risco muito baixo). A Região Centro-Sul também apresentou melhora, saindo da bandeira laranja (risco moderado) para a bandeira amarela (risco baixo). As regiões do Médio Paraíba, Serrana, Norte, Baixada Litorânea e Baía da Ilha Grande permaneceram com bandeira amarela (risco baixo). A Região Noroeste se manteve em bandeira laranja (risco moderado).')
        n20 = Noticia(19,'Governo do RN anuncia desobrigação do uso de máscaras em locais fechados','https://s2.glbimg.com/5F8GEbtqfsjodDP2k5xkWiE0Jog=/0x0:1600x900/984x0/smart/filters:strip_icc()/i.s3.glbimg.com/v1/AUTH_59edd422c0c84a879bd37670ae4f538a/internal_photos/bs/2022/H/n/vPbsgHRPqeY6E1gGxAwA/whatsapp-image-2022-03-10-at-12.58.06-1-.jpeg','O governado do Rio Grande do Norte anunciou a desobrigação do uso de máscaras em locais abertos e fechados do estado a partir desta quarta-feira (6). Segundo o poder Executivo, a flexibilização atendeu uma recomendação do comitê científico da Secretaria de Estado da Saúde Pública (Sesap) que discutiu o assunto em uma reunião na noite de terça-feira (5).')
        n21 = Noticia(20,'Covid: 161,6 milhões de brasileiros completam vacinação, 75,2% da população.','https://conteudo.imguol.com.br/c/noticias/68/2022/01/24/crianca-e-vacinada-em-drive-thru-no-municipio-de-osasco-na-grande-sao-paulo-1643049642579_v2_900x506.jpg.webp','Hoje (6), o Brasil chegou à marca de 161,6 milhões de pessoas que completaram a vacinação contra a covid-19. Ao todo, 161.626.084 habitantes receberam a segunda dose ou a dose única de imunizante, o que representa 75,23% da população nacional. As informações foram compiladas pelo consórcio de veículos de imprensa do qual o UOL faz parte, a partir das informações fornecidas pelas secretarias estaduais de saúde. O ciclo vacinal foi concluído por 243.680 brasileiros entre ontem e hoje, com a aplicação de 239.697 segundas doses e 3.983 únicas. Neste período, 106.186 pessoas tomaram a primeira e 367.582 a de reforço, totalizando 717.448 doses ministradas nas últimas 24 horas.')
        n22 = Noticia(21,'Casos de Covid aumentam em Rondônia na 1ª semana da liberação de máscaras','https://s2.glbimg.com/2zQfBbJTKuEvTdkAveXKkHwhmhg=/0x0:2638x1570/984x0/smart/filters:strip_icc()/i.s3.glbimg.com/v1/AUTH_59edd422c0c84a879bd37670ae4f538a/internal_photos/bs/2021/n/e/A3AzTiT0On8B4jKeN9Pg/covid-rt.jpg','Rondônia registrou um aumento de 62% de casos Covid na primeira semana em que o uso de máscara passou a ser facultativo no estado, tanto em ambientes fechados quanto abertos. Segundo dados disponibilizados no boletim da Secretaria de Estado da Saúde (Sesau), entre a segunda-feira (14) e o sábado (19) foram 3.536 novos casos conhecidos de Covid registrados em sistema. Já na semana anterior, entre 7 e 12 de março, Rondônia teve 2.180 casos em seis dias. Mesmo com o aumento de casos nesta terceira semana do mês, o número ainda ficou abaixo do registrado na primeira semana de março, quando foram 5.728 casos de Covid em cinco dias. Nessa época, o uso de máscara ainda era obrigatório em Rondônia.')
        n23 = Noticia(22,'Uso de máscaras em locais fechados será facultativo, diz prefeitura de Boa Vista','https://s2.glbimg.com/fb7RusFThWfyx5_9vgt5ROp0tEc=/0x0:1600x900/984x0/smart/filters:strip_icc()/i.s3.glbimg.com/v1/AUTH_59edd422c0c84a879bd37670ae4f538a/internal_photos/bs/2022/c/X/JvzCaoSZeeXJlUXj8mzA/whatsapp-image-2022-03-10-at-12.58.07.jpeg','A prefeitura de Boa Vista anunciou nesta terça-feira (5), que vai tornar facultativo o uso de máscaras faciais de proteção contra a Covid-19 em locais fechados na capital. O decreto com esta e outras flexibilizações deve ser publicado no Diário Oficial da quarta-feira (6). O município acrescentou que, apesar do uso passar a ser facultativo, a população deverá seguir algumas orientações que serão disponibilizadas no decreto.')
        n24 = Noticia(23,'Coronavírus em SC: Estado confirma 1.680.292 casos, 1.655.116 recuperados e 21.682 mortes','https://www.sc.gov.br/images/joomgallery/details/setoriais_6457/boletim_05_04_2022_20220405_1693381039.jpeg','Santa Catarina tem 1.680.292 pacientes com teste positivo para Covid-19. Desses, 1.655.116 são considerados recuperados e 3.494 continuam em acompanhamento. O dado foi divulgado nesta terça-feira, 5. Até hoje, 21.682 óbitos foram causados pelo novo coronavírus. Esses números colocam a taxa de letalidade em 1,29%. Houve mais 9 óbitos registrados em comparação com o dia anterior. O total de confirmados cresceu 1.314, enquanto 1.246 pessoas passaram a se enquadrar nos critérios para serem consideradas recuperadas. Esses dados resultam num crescimento de 59 no número de casos ativos.')
        n25 = Noticia(24,'SP tem a menor média móvel de óbitos por Covid-19 desde pico da Ômicron','https://imagens.ebc.com.br/OahA7IYqXAnnbpkTCasXkThXpJA=/1170x700/smart/https://agenciabrasil.ebc.com.br/sites/default/files/thumbnails/image/img_7082.jpg?itok=KYPWhTYx','São Paulo tem a menor média móvel de mortes por Covid-19 desde o pico da variante Ômicron. O estado registrou nesta quarta-feira (6) 42 mortes pela doença na média móvel de 7 dias. “Os dados epidemiológicos da última semana apontam um controle da pandemia no estado com a queda novos casos e óbitos e estabilidade nas novas internações. Os altos índices de vacinação pavimentaram um caminho seguro do enfrentamento da pandemia em SP”, destaca o Secretário de Estado da Saúde, Jean Gorinchteyn. Os novos casos na semana registraram uma redução de 16,6%, tendo um total de 5.287.122 durante toda a pandemia. Entre as internações, o estado tem hoje 1.672 pessoas internadas, sendo 561 em Unidades de Terapia Intensiva e 1.111 em enfermaria. Comparado com o pico da variante Ômicron, o estado de São Paulo tem queda de 86%.')
        n26 = Noticia(25,'Sergipe registra 204 novos casos conhecidos de Covid-19 e três mortes','https://s2.glbimg.com/JPRrB3A_IT2W13vrR-ph52EvO98=/0x0:1024x768/984x0/smart/filters:strip_icc()/i.s3.glbimg.com/v1/AUTH_59edd422c0c84a879bd37670ae4f538a/internal_photos/bs/2022/Z/6/6BSWK6TyeshAOV3rwMsg/noticias.sorocaba.sp.gov.br-drive-thru-a-fome-nao-e-fake-socorro-a-petropolis-tem-testagem-rapida-de-covid-19-neste-domingo-20-e-mais-parcerias-na-arrecadacao-de-alimentos-teste.jpg','Mais de 200 novos casos conhecidos de Covid-19 e três mortes em decorrência da doença foram registradas em Sergipe neste sábado (12), pela Secretaria da Saúde de Sergipe (SES). Os três óbitos confirmados foram: uma mulher, 55 anos, de Aracaju, com doença cardiovascular crônica, diabetes e doença renal crônica; um homem, 67 anos, de São Cristóvão, com hipertensão, diabetes, obesidade, doença pulmonar obstrutiva crônica e tabagismo; um homem, 72 anos, de Tobias Barreto, com neoplasia.')
